// Acessa o primeiro item que chega ao nó, que contém todo o JSON da resposta do Apollo.
const searchResults = $input.first().json;

console.log('=== PREPARANDO LISTA DE CONTATOS PARA A IA ===');

// 1. VERIFICAÇÃO DE SEGURANÇA E EXTRAÇÃO DOS DADOS:
// Confirma se a resposta do Apollo existe e contém a propriedade 'people'.
if (!searchResults || !Array.isArray(searchResults.people)) {
    console.log("A propriedade 'people' não foi encontrada ou não é uma lista. Encerrando.");
    return [{
        json: {
            success: false,
            erro: "A propriedade 'people' não foi encontrada na busca.",
            contatos_para_ia: []
        }
    }];
}

// ACHATAMENTO DA LISTA:
// O método .flat() transforma a lista de listas (ex: [[a,b], [c,d]]) em uma única lista ([a,b,c,d]).
// Isso garante que todos os contatos de todas as sub-listas sejam processados juntos.
const pessoas = searchResults.people.flat();

if (pessoas.length === 0) {
    console.log('Nenhuma pessoa encontrada na lista final. Encerrando o processamento.');
    return [{
        json: {
            success: false,
            erro: 'Nenhuma pessoa encontrada na busca.',
            contatos_para_ia: []
        }
    }];
}

console.log(`Encontrados e achatados ${pessoas.length} contatos. Formatando para a IA...`);

// 2. MAPEAMENTO E LIMPEZA:
// Transforma a lista completa em uma lista simples, contendo apenas o que a IA precisa.
const contatos_para_ia = pessoas.map(person => {
    return {
        id: person.id,          // Essencial para o passo de enriquecimento futuro
        nome: person.name,      // Nome completo do contato
        cargo: person.title,    // O principal dado para a análise da IA
        linkedin_url: person.linkedin_url || '' // Incluindo o LinkedIn para referência futura
    };
});

// 3. RETORNO ESTRUTURADO:
// Envia a lista limpa para o próximo nó do workflow (o nó de IA).
return [{
    json: {
        success: true,
        contatos_para_ia: contatos_para_ia
    }
}];

// =================================================================
// FUNÇÕES DE APOIO
// =================================================================

/**
 * Função para definir a prioridade da fila (1 a 5) com base nos critérios.
 * @param {string} classificacao - 'A', 'B', ou 'C', fornecida pela IA.
 * @param {boolean} temTelefone - Se o contato tem telefone.
 * @param {boolean} emailVerificado - Se o e-mail é verificado.
 * @returns {number} - A prioridade de 1 a 5.
 */
function getPrioridade(classificacao, temTelefone, emailVerificado) {
  if (classificacao === 'A' || classificacao === 'B') {
    if (temTelefone && emailVerificado) return 1;
    if (temTelefone && !emailVerificado) return 2;
    if (!temTelefone && emailVerificado) return 3;
  }
  if (classificacao === 'C') {
    if (temTelefone && emailVerificado) return 4;
    if (temTelefone || emailVerificado) return 5;
  }
  return 5; // Prioridade mais baixa para qualquer outro caso.
}

/**
 * Função para formatar números de telefone.
 * @param {string} rawPhone - O número de telefone bruto.
 * @returns {string} - O número de telefone formatado.
 */
function formatarTelefone(rawPhone) {
  if (!rawPhone || typeof rawPhone !== 'string') return '';
  const numeroLimpo = rawPhone.replace(/\D/g, '');
  if (numeroLimpo.startsWith('55') && numeroLimpo.length === 13) {
    const ddd = numeroLimpo.substring(2, 4);
    const numeroLocal = numeroLimpo.substring(4);
    if (numeroLocal.startsWith('9')) {
      return `55${ddd}${numeroLocal.substring(1)}`;
    }
  }
  return numeroLimpo;
}

/**
 * Gera um email aleatório e único para contatos sem email válido.
 * @param {string} baseId - O ID do contato para ajudar a criar um email único.
 * @returns {string} - Um email aleatório no formato placeholder_[ID]_[timestamp]@placeholder.com
 */
function gerarEmailAleatorio(baseId) {
  const timestamp = Date.now();
  const idPart = baseId ? String(baseId).replace(/[^a-zA-Z0-9]/g, '') : 'id_nao_encontrado';
  return `placeholder_${idPart}_${timestamp}@placeholder.com`;
}


// =================================================================
// LÓGICA PRINCIPAL DE PROCESSAMENTO
// =================================================================

// 1. Captura resultados do nó de enriquecimento (HTTP Request) e dados originais
const enrichmentResults = $input.all();
const pessoasOriginais = $('Preparar payload para Apollo').all().map(node => node.json);

// 2. Captura dados da empresa
const empresaData = $('Processar People Search').first().json;

// 3. Monta cada resultado enriquecido
const resultados = enrichmentResults.map((item, index) => {
  const enrichment = item.json;
  const orig = pessoasOriginais[index] || {};
  let contato = {};

  if (enrichment && enrichment.person) {
    const p = enrichment.person;
    // Telefone
    let telRaw = '';
    if (Array.isArray(p.phone_numbers) && p.phone_numbers.length) {
      telRaw = p.phone_numbers[0].sanitized_number || p.phone_numbers[0].raw_number || '';
    }
    const telefone = formatarTelefone(telRaw);

    // Email
    let email = p.email || orig.email || '';
    if (email === 'email_not_unlocked@domain.com' || !email.includes('@')) {
      email = gerarEmailAleatorio(p.id || orig.id);
    }

    // Nome e cargo
    const nomeCompleto = `${p.first_name || orig.first_name || ''} ${p.last_name || orig.last_name || ''}`.trim();
    const cargoFinal = p.title || orig.title || '';

    // Flags e status
    const temTelefone = telefone.length >= 10;
    const temNome = nomeCompleto.length >= 2;
    const validStatus = ['verified','unverified','unknown','invalid'];
    let emailStatus = (p.email_status || 'unknown').toLowerCase();
    if (!validStatus.includes(emailStatus)) emailStatus = 'unknown';

    // Classificação e prioridade
    const classificacao = orig.classificacao_contato || 'C';
    const prioridade = getPrioridade(classificacao, temTelefone, emailStatus === 'verified');

    // Quality score
    let qualityScore = 0;
    if (p.first_name && p.last_name) qualityScore += 20;
    if (p.title) qualityScore += 30;
    if (email && emailStatus === 'verified') qualityScore += 30;
    if (telefone) qualityScore += 20;
    const dataQuality = qualityScore >= 80 ? 'high' : qualityScore >= 50 ? 'medium' : 'low';

    contato = {
      empresa_id: empresaData.empresa_id,
      nome_contato: nomeCompleto,
      cargo: cargoFinal,
      apollo_job_title: cargoFinal,
      linkedin_url: p.linkedin_url || orig.linkedin_url || '',
      apollo_api_person_id: p.id || orig.id || null,
      apollo_email_verified: emailStatus === 'verified',
      email_status: emailStatus,
      classificacao_contato: classificacao,
      prioridade_contato: prioridade,
      quality_score: qualityScore,
      apollo_api_data_quality: dataQuality,
      fonte_contato: 'apollo_api_webhook',
      status_contato: 'pendente_confirmacao',
      whatsapp_valido: false,
      chatwoot_sync_status: 'pending_apollo_data',
      revelado: true,
      apollo_webhook_pending: true,
      apollo_webhook_url: 'https://n8n-n8n-start.5ikbes.easypanel.host/webhook/apollo-enrichment-confirmation',
      apollo_enrichment_requested_at: new Date().toISOString(),
      enviado_para_chatwoot: false,
      foi_disparado: false,
      tem_email: true,
      tem_telefone: temTelefone,
      tem_nome: temNome,
      valido: false,
      email: email,
      telefone: temTelefone ? telefone : null,
      apollo_api_enriched_at: new Date().toISOString(),
      apollo_api_enrichment_type: 'enrichment'
    };
  } else {
    // Fallback sem enriquecimento Apollo
    let email = orig.email || '';
    if (email === 'email_not_unlocked@domain.com' || !email.includes('@')) {
      email = gerarEmailAleatorio(orig.id);
    }
    const nomeCompleto = `${orig.first_name || ''} ${orig.last_name || ''}`.trim();
    const clasific = orig.classificacao_contato || 'C';
    const prioridade = getPrioridade(clasific, false, false);

    contato = {
      empresa_id: empresaData.empresa_id,
      nome_contato: nomeCompleto,
      cargo: orig.title || '',
      apollo_job_title: orig.title || '',
      linkedin_url: orig.linkedin_url || '',
      apollo_api_person_id: orig.id || null,
      apollo_email_verified: false,
      email_status: 'unknown',
      classificacao_contato: clasific,
      prioridade_contato: prioridade,
      quality_score: 30,
      apollo_api_data_quality: 'low',
      fonte_contato: 'apollo_api_search_only',
      status_contato: 'pendente_confirmacao',
      tem_email: true,
      tem_telefone: false,
      tem_nome: nomeCompleto.length >= 2,
      valido: false,
      email: email
      // (adapte outros campos de fallback conforme necessário)
    };
  }

  return { json: contato };
});

// 4. REMOVER DUPLICATAS PELO apollo_api_person_id
const resultadosUnicos = Array.from(
  new Map(
    resultados.map(item => [
      item.json.apollo_api_person_id,
      item
    ])
  ).values()
);

// 5. RETORNAR SÓ OS ÚNICOS
return resultadosUnicos;

// 1. OBTER OS DADOS DE MÚLTIPLAS FONTES
const resultadoIA = $input.first().json.output;
const todosOsContatosBrutos = $('Aggregate').first().json.people;

// 2. VERIFICAÇÃO DE SEGURANÇA
if (!resultadoIA || !Array.isArray(resultadoIA.pessoas_selecionadas) || resultadoIA.pessoas_selecionadas.length === 0) {
  console.log('A IA não retornou uma lista de pessoas selecionadas. Encerrando.');
  return []; 
}
if (!todosOsContatosBrutos || !Array.isArray(todosOsContatosBrutos)) {
  console.log("Não foi possível encontrar a lista 'people' no nó Aggregate. Verifique o nome do nó e sua saída.");
  return [];
}

// 3. CORREÇÃO DA ESTRUTURA DE DADOS
const todosOsContatosOriginais = todosOsContatosBrutos.flat();

// 4. MAPEAR IDS SELECIONADOS E SUAS CLASSIFICAÇÕES
const pessoasSelecionadas = resultadoIA.pessoas_selecionadas;
const totalDesejado = resultadoIA.total_selecionado;

const classificacaoMap = new Map();
const idsSelecionados = new Set();

for (const pessoa of pessoasSelecionadas) {
  const id = String(pessoa.id).trim();
  idsSelecionados.add(id);
  classificacaoMap.set(id, pessoa.classificacao);
}

// 5. FILTRAR E ENRIQUECER APENAS OS CONTATOS SELECIONADOS
const contatosSelecionados = todosOsContatosOriginais
  .filter(contato => {
    const contatoId = String(contato.id || contato._id).trim();
    return idsSelecionados.has(contatoId);
  })
  .slice(0, totalDesejado) // Garante que não excede o total_selecionado
  .map(contato => {
    const contatoId = String(contato.id || contato._id).trim();
    return {
      ...contato,
      classificacao_contato: classificacaoMap.get(contatoId)
    };
  });

console.log(`Total solicitado pela IA: ${totalDesejado}`);
console.log(`Contatos enriquecidos retornados: ${contatosSelecionados.length}/${pessoasSelecionadas.length}`);

// 6. RETORNAR OS DADOS NO FORMATO ESPERADO
return contatosSelecionados.map(contato => ({ json: contato }));
